import axios from 'axios';

async function teamsUpdater() {
    let query = await axios({
        url: "http://140.112.174.222:1484/wind/fetch", 
        method: "post", 
        data: {
            mes: "123", 
        }, 
    });
    console.log(query.data);

    var teams = [];

    for (var i = 1; i <= 8; i++) {
        teams.push({
            "rank": 9 - i, 
            "ID": i, 
            "score": (9 - i) * 10, 
            "history": [
                {
                    "RFID": "12345678", 
                    "score": (9 - i) * 10, 
                    "timestamp": new Date().toISOString().replace(/T/, ' ').replace(/\..+/, ''), 
                }
            ]
        });
    }

    teams.sort((A, B) => (A.rank > B.rank) ? 1 : ((A.rank < B.rank) ? -1 : 0));

    return teams;
}

export default teamsUpdater;
